import {FETCH_PRODUCTS} from "../actions";

const initialState = {
    products: {}
};

export default function (state = initialState, action) {
    switch (action.type) {
        case FETCH_PRODUCTS:
            return {
                products: action.payload
            }
    }

    return state;
}
